# 解析数据
points = []
for entry in points_str.strip(';').split(';'):
    lon, lat = map(float, entry.split(','))
    lon, lat = gcj02_to_wgs84(lon, lat)  # 坐标系转换！
    points.append((lat, lon))

# 计算时间间隔（注意起点和终点的顺序问题）
total_points = len(points)
start_timestamp_ms = 1690521872172
end_timestamp_ms = 1690467927000
start_time = datetime.utcfromtimestamp(start_timestamp_ms / 1000.0)
end_time = datetime.utcfromtimestamp(end_timestamp_ms / 1000.0)
if start_time > end_time:
    start_time, end_time = end_time, start_time  # 保证时间顺序正确

total_seconds = (end_time - start_time).total_seconds()
interval = total_seconds / (total_points - 1)

# 生成GPX
gpx = ET.Element('gpx', version="1.1", creator="Generated by Script", xmlns="http://www.topografix.com/GPX/1/1")
trk = ET.SubElement(gpx, 'trk')
trkseg = ET.SubElement(trk, 'trkseg')

for idx, (lat, lon) in enumerate(points):
    trkpt = ET.SubElement(trkseg, 'trkpt', lat=str(lat), lon=str(lon))
    time_elem = ET.SubElement(trkpt, 'time')
    point_time = start_time + timedelta(seconds=interval * idx)
    time_elem.text = point_time.strftime("%Y-%m-%dT%H:%M:%SZ")

# 文件名，用起点UTC时间
file_name = start_time.strftime("%Y%m%d%H%M%S") + ".gpx"

# 保存文件
tree = ET.ElementTree(gpx)
tree.write(file_name, encoding='utf-8', xml_declaration=True)

print(f"GPX文件已生成：{file_name}")